import React, { Component } from 'react';
import './App.css';

class App extends Component {

  state = {
    restaurants: []
  }

  componentDidMount() {

  }

  getRestaurants = _ => 
    fetch('http://localhost:5000/restaurants')
    .then(response => response.json())
    .then(({data}) => {
      console.log(data)
    })



  renderProduct = ({ restrntID, Name }) => <div key={restrntID}>{Name}</div>

  render() {
    const { restaurants } = this.state
    return (
      <div className="App">
        {restaurants.map(this.renderProduct)}
      </div>
    )
  }
}

export default App;
